INSERT INTO kerdesek VALUES("9","1","Ha megtudod, hogy ismerősöd egy olyan terméket akar venni, amelyre te is vágytál régen, csak már elfelejtetted, akkor mit tennél?","If you knew that one of your friend wants to buy a product what you want to get it eagerly so long ago, just you forgot, what would you do?","Was würdest du tun, wenn du erfährt, dass eine deiner Bekannten ein Produkt kaufen will, das du einmal wolltest, hast jedoch vergessen?","","","9","radio","1","");
INSERT INTO kerdesek VALUES("10","1","Ha tudod, hogy egy barátod mire vágyik és ajándékot akarnál venni, de túl drága, megosztanád barátod ismerőseivel, hogy szálljanak be a költségekbe?","If you knew the dream of one of your friend, and you wanted to buy a gift, but it was too expensive, would you tell acquintances of your friend to share the cost?","Wenn du weißt, was dein Freund möchte und du willst ein Geschenk kaufen, das Geschenk ist jedoch zu teuer, würdest du die Bekannten deines Freundes fragen sich an den Kosten zu beteiligen?","","","10","radio","1","");
